import React from "react";
import { connect } from "react-redux";
const ShowTodo = ({ todos, filter }) => {
  return (
    <table className="table table-dark container table-bordered table-collapsed text-center">
      <thead>
        <tr>
          <th>SR</th>
          <th>TODO </th>
          <th>STATUS</th>
        </tr>
      </thead>
      <tbody>
        {todos.map((todo, index) => {
          return (
            <tr>
              <td>{}</td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

const mapStateToProps = state => {
  return state;
};

export default connect(mapStateToProps)(ShowTodo);
